import React from "react";
//import PropTypes from "prop-types";

const Del = props => {
  return (
    <div>
      <div>Do you wish to delete {props.student.name}?</div>;
      <button onClick={props.deleteStudent(props.student._id)}>Yes</button>
      <button onClick={props.returnToList()}>No</button>
    </div>
  );
};

export default Del;
